import React from 'react';
import { useParams } from 'react-router-dom';

const vehicleData = {
  1: { name: 'Toyota Camry', mileage: 32000, oilChangeDue: true },
  2: { name: 'Honda Accord', mileage: 27000, oilChangeDue: false },
  3: { name: 'Ford F-150', mileage: 45000, oilChangeDue: true },
};

function VehicleDetail() {
  const { id } = useParams();
  const vehicle = vehicleData[id];

  if (!vehicle) return <h2>Vehicle not found.</h2>;

  return (
    <div className="dashboard">
      <h2>{vehicle.name} Details</h2>
      <p><strong>Mileage:</strong> {vehicle.mileage.toLocaleString()} km</p>
      <p><strong>Oil Change Due:</strong> {vehicle.oilChangeDue ? 'Yes' : 'No'}</p>
    </div>
  );
}

export default VehicleDetail;
